import { Link } from 'react-router-dom';
import btn from '../assets/btn1.png';
import background from '../assets/bgr1.jpg';

export default function MenuIntro() {



  return (
    <div className="float top-0 bg-white overflow-hidden mb-auto z-0 items-center  justify-center">
      <div className='absolute'> 
        <img className="absolute"  src={background} alt="Unknown"/>

        </div>


      <Link to='/menu' >
        <img className='relative' src={btn} alt="Unknown" ></img>
      </Link>

      <h1 className='relative  overflow-hidden mb-auto z-0 items-center  justify-center'> <b>Our Food</b></h1>
    </div>
  )
}
